import React from "react";
import './PokemonContent.css'

const RenderPokemonContent = (pokemonId) => {
    
    return (
        <div className='pokemon-content'>
            <p>Poke Content - id no. {pokemonId.input}</p>
        </div>
    )
}

export default RenderPokemonContent;
